import React from "react";
import "./ProductPage.css";

const ProductPage = () => {
  return (
    <div className="product-page container">
      <h3 className="product-title">Best Choices</h3>
      <h4 className="sub-title">Best Shoes</h4>
      
      <div className="row product-carousel">
        {/* Scrolling left icon */}
        <div className="col-1 scroll-icon text-center">
          <i className="fas fa-chevron-left"></i>
        </div>
        
        {/* Scrollable cards */}
        <div className="col-10 product-cards">
          {/* Card 1 */}
          <div className="product-card card">
            <img src="/images/shoe1.jpg" alt="Shoe 1" className="card-img-top" />
            <div className="card-body">
              <h5 className="card-title">Running Shoe</h5>
              <p className="card-text">Comfortable and stylish for your runs.</p>
            </div>
          </div>
          {/* Add more cards... */}
        </div>
        
        {/* Scrolling right icon */}
        <div className="col-1 scroll-icon text-center">
          <i className="fas fa-chevron-right"></i>
        </div>
      </div>
    </div>
  );
};

export default ProductPage;
